import { Buffer } from "buffer";
import * as oasis from "oasis-std";
export class Ballot {
  public static BYTECODE =
    "";
  private constructor(
    readonly address: oasis.Address,
    private gateway: oasis.Gateway
  ) {}
  public static async connect(
    address: oasis.Address,
    gateway: oasis.Gateway
  ): Promise<Ballot> {
    return new Ballot(address, gateway);
  }
  public static async deploy(
    gateway: oasis.Gateway,
    { description, candidates }: { description: string; candidates: string[] },
    options?: oasis.DeployOptions
  ): Promise<Ballot> {
    const payload = Ballot.makeDeployPayload(description, candidates);
    try {
      const deployedAddr = await gateway.deploy(payload, options);
      return new Ballot(deployedAddr, gateway);
    } catch (e) {
      throw e;
    }
  }
  private static makeDeployPayload(
    description: string,
    candidates: string[]
  ): Buffer {
    const encoder = new oasis.Encoder();
    encoder.writeU8Array(Buffer.from(Ballot.BYTECODE, "base64"));
    return oasis.abiEncode(
      [
        "string" as oasis.Schema,
        ["string", Number.POSITIVE_INFINITY] as oasis.Schema
      ],
      [description, candidates],
      encoder
    );
  }
  public async candidates(options?: oasis.RpcOptions): Promise<string[]> {
    const payload = Ballot.makeCandidatesPayload();
    try {
      const res = await this.gateway.rpc(this.address, payload, options);
      return oasis.abiDecode(
        ["string", Number.POSITIVE_INFINITY] as oasis.Schema,
        res
      );
    } catch (e) {
      throw e;
    }
  }
  private static makeCandidatesPayload(): Buffer {
    const encoder = new oasis.Encoder();
    encoder.writeU8(0);
    return encoder.finish();
  }
  public async description(options?: oasis.RpcOptions): Promise<string> {
    const payload = Ballot.makeDescriptionPayload();
    try {
      const res = await this.gateway.rpc(this.address, payload, options);
      return oasis.abiDecode("string" as oasis.Schema, res);
    } catch (e) {
      throw e;
    }
  }
  private static makeDescriptionPayload(): Buffer {
    const encoder = new oasis.Encoder();
    encoder.writeU8(1);
    return encoder.finish();
  }
  public async votingOpen(options?: oasis.RpcOptions): Promise<boolean> {
    const payload = Ballot.makeVotingOpenPayload();
    try {
      const res = await this.gateway.rpc(this.address, payload, options);
      return oasis.abiDecode("boolean" as oasis.Schema, res);
    } catch (e) {
      throw e;
    }
  }
  private static makeVotingOpenPayload(): Buffer {
    const encoder = new oasis.Encoder();
    encoder.writeU8(2);
    return encoder.finish();
  }
  public async vote(
    { candidateNum }: { candidateNum: number },
    options?: oasis.RpcOptions
  ): Promise<void> {
    const payload = Ballot.makeVotePayload(candidateNum);
    try {
      const res = await this.gateway.rpc(this.address, payload, options);
      return;
    } catch (e) {
      if (e instanceof oasis.RpcError.Execution) {
        throw oasis.abiDecode("string" as oasis.Schema, e[0]);
      }
      throw e;
    }
  }
  private static makeVotePayload(candidateNum: number): Buffer {
    const encoder = new oasis.Encoder();
    encoder.writeU8(3);
    return oasis.abiEncode(["u32" as oasis.Schema], [candidateNum], encoder);
  }
  public async close(options?: oasis.RpcOptions): Promise<void> {
    const payload = Ballot.makeClosePayload();
    try {
      const res = await this.gateway.rpc(this.address, payload, options);
      return;
    } catch (e) {
      if (e instanceof oasis.RpcError.Execution) {
        throw oasis.abiDecode("string" as oasis.Schema, e[0]);
      }
      throw e;
    }
  }
  private static makeClosePayload(): Buffer {
    const encoder = new oasis.Encoder();
    encoder.writeU8(4);
    return encoder.finish();
  }
  public async winner(options?: oasis.RpcOptions): Promise<number> {
    const payload = Ballot.makeWinnerPayload();
    try {
      const res = await this.gateway.rpc(this.address, payload, options);
      return oasis.abiDecode("u32" as oasis.Schema, res);
    } catch (e) {
      if (e instanceof oasis.RpcError.Execution) {
        throw oasis.abiDecode("string" as oasis.Schema, e[0]);
      }
      throw e;
    }
  }
  private static makeWinnerPayload(): Buffer {
    const encoder = new oasis.Encoder();
    encoder.writeU8(5);
    return encoder.finish();
  }
  public async results(options?: oasis.RpcOptions): Promise<Uint32Array> {
    const payload = Ballot.makeResultsPayload();
    try {
      const res = await this.gateway.rpc(this.address, payload, options);
      return oasis.abiDecode(
        ["u32", Number.POSITIVE_INFINITY] as oasis.Schema,
        res
      );
    } catch (e) {
      if (e instanceof oasis.RpcError.Execution) {
        throw oasis.abiDecode("string" as oasis.Schema, e[0]);
      }
      throw e;
    }
  }
  private static makeResultsPayload(): Buffer {
    const encoder = new oasis.Encoder();
    encoder.writeU8(6);
    return encoder.finish();
  }
}
